import React from "react";
import "../styles/Login.css";
import { useNavigate } from "react-router-dom";

export default function Login() {
  const navigate = useNavigate();

  const handleStart = () => {
    navigate("/dashboard"); // Go to dashboard when button is clicked
  };

  return (
    <div className="login-container">
      {/* Left Content (Blurred) */}
      <div className="login-content">
        <h1>Welcome to Freelancer Manager</h1>
        <p>
          Are you free now? Pick a project, work on your terms, and start earning today!
        </p>
        <button className="get-started-btn" onClick={handleStart}>
          Get Started
        </button>
      </div>

      {/* Right Image */}
      <div className="login-image"></div>
    </div>
  );
}
